export function Cart(props2) {

    return (
        <div className="navbar">
          <div className="logo">Q</div> {/* The logotype "Q" */}
          <div className="menu">
            <a href="#">Demos</a>
            <a href="#">Post</a>
            <a href="#">Features</a>
            <a href="#">Categories</a>
            <a href="#">Shop</a>
            <a href="#" className="buynow">Buy Now</a>
          </div>
        </div>
      );
}


